import { lg_api } from "../__modules__";

function likePost(e) {
  if (String(e.nativeEvent.path[1].id).startsWith("likes_post")) {
    console.log("Likes");
    lg_api(`posts/${e.nativeEvent.path[4].id}`, {
      method: "post",
      data: {
        likes: 1,
      },
    }).then((res) => {
      console.log(res);
    });
  }
}

export {likePost}
